import logo from './pluginIcon.png';
import './App.css';
import filePath from './input.txt';
import { useState } from 'react';

function getContent() {
  //const [ text, setText ] = useState();

  /*
  fetch(filePath)
  .then(r => r.text())
  .then(text => {
    console.log(text);
  });
  */

  var contentArray;

  const fileReader = new FileReader();
  fileReader.onload = event => {
    const fileText = event.target.result;
    const lines = fileText.split('\n');
    contentArray += lines;
  };

  const file = new Blob([filePath], {type: 'text/plain'});
  fileReader.readAsText(file);

  //return lines;
}

function App() {

   return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <code>adventofcode.com/2023</code> 
        </p>
        <a
          className="App-link"
          href="https://adventofcode.com/2023/day/1"
          target="_blank"
          rel="noopener noreferrer"
        >
          Day 1: Trebuchet?!
        </a>
      </header>
      <body className="App-body">
        List of strings {contentArray}
      </body>
    </div>
  );
}

export default App;
